import React from 'react';
import { GoogleLogin } from 'react-google-login';
import { useNavigate } from 'react-router-dom';

const GoogleLoginButton = () => {
  const navigate = useNavigate();

  const responseGoogle = (response) => {
    console.log(response); // Check the structure of the response object

    if (response && response.profileObj) {
      const { imageUrl, name, email } = response.profileObj;
      console.log('Profile Photo URL:', imageUrl);
      console.log('Name:', name);
      console.log('Email:', email);

      navigate('/dashboard');
    } else if (response && response.profile) {
      const { imageUrl, name, email } = response.profile;
      console.log('Profile Photo URL:', imageUrl);
      console.log('Name:', name);
      console.log('Email:', email);

      navigate('/dashboard');
    } else {
      console.log('Login failed'); // Add an error log
      navigate('/login');
    }
  };

  return (
    <GoogleLogin
      clientId="798504094336-id3r3n1ldom2rjmsa6tdp6db0oii5nct.apps.googleusercontent.com"
      buttonText="Login with Google"
      onSuccess={responseGoogle}
      onFailure={responseGoogle}
      cookiePolicy={'single_host_origin'}
    />
  );
};

export default GoogleLoginButton;
